import React from "react";
import "./About.css";

const About = () => {
  return (
    <div className="about-content">
      <p>
        I worked mainly as a Java Developer, now I wanting to expand my
        expertise to javascript.
        <br />
        Email: ramilatangan@gmail.com
      </p>
    </div>
  );
};

export default About;
